import React from 'react'
import Pizza from '../components/Pizza'
import pizzas from '../pizzasdata'
export default function Homepage() {
  return (
    <div>
        
        <div className='row'>
            {
                pizzas.map(pizza=>{
                    return <div className='col-mid-4'>
                        <div>
                            <pizza  pizza={pizza}/>
                        </div>

                    </div>
                }
                    
                )
            }
        </div>
    </div>
  )
}
